import React from 'react';

import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css';

import kitty from '../images/orange_cat.png';
import AboutMe from './AboutMe';
import ContactMe from './ContactMe';

export default function Navigation() {

    const bootstrapStyling = {

    }

    return (
        <Navbar bg="light" expand="lg">
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"/>
            <img src={kitty} className="kitty" alt="logo orange cat image"/>
                <Nav className="mr-auto w-100">

                    <Nav.Link className="text-white" href="https://github.com/ilgharr" target="_blank">
                        <i className="fa fa-github"></i>
                        GitHub
                    </Nav.Link>

                    <Nav.Link className="text-white" href="https://www.linkedin.com/in/ilghar-rahno-5a40aa220/" target="_blank">
                        <i className="fa fa-linkedin-square"></i>
                        Linkedin
                    </Nav.Link>

                    <Nav.Link className="text-white">
                        <AboutMe/>
                    </Nav.Link>

                    <Nav.Link className="text-white">
                        <ContactMe/>
                    </Nav.Link>

                </Nav>
        </Navbar>

    )
}
